import { StrictMode } from "react";
import { NavVertical } from "../../components/Nav";

class ConceptsPage {
    constructor({ course }) {
        this.course = course;
    }
}
({ course }) => {
    return (
        <StrictMode>
            <section>
                <nav className="nav-vertical">
                    <NavVertical />
                </nav>
            </section>
        </StrictMode>
    );
};
